import "./style.css";
function App() {
  return (
    <div className="nav">
      <div className="nav__list">
        <div className="nav__btn">1</div>
        <div className="nav__btn">2</div>
        <div className="nav__btn">3</div>
        <div className="nav__btn">4</div>
      </div>
    </div>
  );
}

export default App;
